<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Figma</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.10.5/font/bootstrap-icons.css">
</head>
<body class="bg-gray-100 overflow-x-hidden"> 


<div class="h-[80vh] md:h-[60vh] bg-cover bg-center relative" 
    style="background-image: url('https://tse2.mm.bing.net/th?id=OIP.jt6i4yeTO_zMnivpc9nqXQHaEJ&pid=Api&P=0&h=180');">

   
    <div class="flex items-center justify-between px-6 md:px-36 py-4">
        <div class="flex items-center space-x-4">
            <img src="https://th.bing.com/th?id=OIP.XfloBSB32f50RImZskOHFwHaHa&w=250&h=250&c=8&rs=1&qlt=90&o=6&dpr=1.3&pid=3.1&rm=2"
                 alt="Studio Logo" class="w-16 h-16 md:w-20 md:h-20 object-cover">
        </div>

        <div class="flex space-x-6 text-lg">
            <a href="#" class="text-yellow-500 hover:text-yellow-400 font-extrabold">Home</a>
            <a href="#" class="text-white font-extrabold">About</a>
            <a href="#" class="text-white hover:text-gray-200 font-extrabold">Work</a>
            <a href="#" class="text-black hover:text-gray-200 font-extrabold">Galleries</a>
            <a href="#" class="text-white hover:text-gray-200 font-extrabold">Features</a>
            <a href="#" class="text-white hover:text-gray-200 font-extrabold">Blogs</a>
        </div>
    </div>

    
    <div class="absolute inset-0 flex item-center justify-end px-6">
        <div class="text-center w-full">
            <h2 class="text-3xl md:text-4xl font-extrabold mb-4 text-white">
                Welcome to Our <span class="text-yellow-500">Smart Studio</span>
            </h2>
            <p class="text-base md:text-lg text-white mb-6">
                Experience the best photography in town
            </p>

            <div class="flex justify-center">
                <form class="w-full md:w-2/3 lg:w-1/2">
                    <input 
                        class="border rounded px-4 py-3 w-full text-gray-800 focus:outline-none focus:ring-2 focus:ring-indigo-500" 
                        type="text" placeholder="Search for photos..." required>
                </form>
            </div>
        </div>
    </div>
</div>
<div class="bg-white py-12">
    <div class="text-left px-6 md:px-36">
        <h1 class="text-2xl md:text-3xl font-bold text-gray-800 mb-4">
            Bringing Dreams To <span class="text-yellow-500">Reality</span>
        </h1>
        <p class="text-lg md:text-xl text-gray-600">
            We provide exceptional photography services that capture your moments beautifully.
        </p>
    </div>
</div>


<section class="container mx-auto py-12 px-6">
    <div class="grid grid-cols-1 md:grid-cols-3 gap-6">
        
        <div>
            <img src="https://th.bing.com/th/id/OIP.MYBXwqjBG1K3zIggNQN53QHaEK?w=334&h=187&c=7&r=0&o=5&dpr=1.3&pid=1.7" 
                 alt="" class="w-full h-auto object-cover rounded-md shadow-lg">
        </div>

        
        <div>
            <img src="https://www.99inspiration.com/wp-content/uploads/2018/01/Beautiful-Fine-Art-Portrait-Photography-by-Bella-Kotak-10.jpg" 
                 alt="" class="w-full h-auto object-cover rounded-md shadow-lg">
        </div>

    
        <div>
            <img src ="data:image/jpeg;base64," 
                 alt="" class="w-full h-auto object-cover rounded-md shadow-lg">
        </div>
    </div>
</section>
<div class="bg-white py-12">
<div class="flex items-center px-6 md:px-36 space-x-8">
    
        <a href="#" 
           class="flex items-center space-x-2 bg-yellow-500 text-white px-6 py-3 rounded-lg 
                  shadow hover:bg-yellow-600 transition duration-300">
            <i class="bi bi-arrow-right-circle"></i> 
            <span>View All Services</span>
        </a>


</div>
</div>


</body>
</html>
